import React, {useEffect} from 'react';
import Container from "../../Components/Container/Container";
import {useHttp} from "../../Hooks/http.hook";

const RopesInStock = () => {
    const {loading, error, request} = useHttp();
    useEffect(async () => {
        const ropesInStock = await request('http://localhost:8000/api/ropes/getAllRopes', 'GET')
        console.log(ropesInStock);
    }, [])
    return (
        <Container>
            <div>
                Ropes in stock page
            </div>
        </Container>
    );
};

export default RopesInStock;
